// src/controllers/fusionadosController.ts
var fusionadosController = async (req, res) => {
  try {
    const id = parseInt(req.params.id, 10);
    if (isNaN(id) || id < 1) {
      return res.status(400).json({ error: "ID inv\xE1lido. Debe ser un n\xFAmero mayor que 0." });
    }
    const { data: peopleData } = await axios_default.get(`https://swapi.info/api/people/${id}/`);
    const { data: planetData } = await axios_default.get(peopleData.homeworld);
    const planetName = planetData.name;
    const location2 = planetCoordinateMap[planetName];
    let weather = {
      temperature: "No disponible",
      windspeed: "No disponible",
      condition_code: "No disponible"
    };
    if (location2) {
      const { data: weatherData } = await axios_default.get("https://api.open-meteo.com/v1/forecast", {
        params: {
          latitude: location2.lat,
          longitude: location2.lon,
          current_weather: true
        }
      });
      weather = {
        temperature: `${weatherData.current_weather.temperature} \xB0C`,
        windspeed: `${weatherData.current_weather.windspeed} km/h`,
        condition_code: weatherData.current_weather.weathercode
      };
    }
    const result = {
      character: peopleData.name,
      height: peopleData.height,
      mass: peopleData.mass,
      homeworld: planetName,
      climate: planetData.climate,
      terrain: planetData.terrain,
      weather
    };
    await guardarFusionado({
      characterName: peopleData.name,
      height: peopleData.height,
      mass: peopleData.mass,
      homeworld: planetName,
      climate: planetData.climate,
      terrain: planetData.terrain,
      temperature: weather.temperature,
      windspeed: weather.windspeed,
      conditionCode: weather.condition_code
    });
    console.log("Resultado guardado en base de datos");
    return res.status(200).json(result);
  } catch (error) {
    console.error("Error en fusionadosController:", error);
    return res.status(500).json({ error: "Ocurri\xF3 un error al obtener datos." });
  }
};

// src/services/historialService.ts
var obtenerHistorialPaginado = async (page = 1, limit = 10) => {
  const safePage = Math.max(Number(page), 1);
  const safeLimit = Math.max(Number(limit), 1);
  const offset = (safePage - 1) * safeLimit;
  const query = `
    SELECT
      id,
      character_name,
      height,
      mass,
      homeworld,
      climate,
      terrain,
      temperature,
      windspeed,
      condition_code,
      created_at
    FROM tb_fusionados
    ORDER BY created_at ASC
    LIMIT ${safeLimit} OFFSET ${offset}
  `;
  const [rows] = await database_default.query(query);
  return rows;
};
var contarTotalFusionados = async () => {
  const [rows] = await database_default.query(`SELECT COUNT(*) as total FROM tb_fusionados`);
  return rows[0].total;
};

// src/controllers/historialController.ts
var historialController = async (req, res) => {
  try {
    const page = parseInt(req.query.page) || 1;
    const limit = parseInt(req.query.limit) || 10;
    if (isNaN(page) || isNaN(limit) || page < 1 || limit < 1) {
      return res.status(400).json({ error: "Par\xE1metros de paginaci\xF3n inv\xE1lidos." });
    }
    const historial = await obtenerHistorialPaginado(page, limit);
    const total = await contarTotalFusionados();
    return res.status(200).json({
      total,
      page,
      limit,
      totalPages: Math.ceil(total / limit),
      results: historial
    });
  } catch (error) {
    console.error("Error al obtener historial:", error.message);
    return res.status(500).json({ error: "Error al obtener historial" });
  }
};

